    @Bean
    @Override
    public MockGenomeNexusImpl annotator() {
        return this;
    }

    public AnnotatedRecord makeMockAnnotatedRecord(MutationRecord record) {
        GenomeNexusAnnotationResponse gnResponse = null;
        try {
            gnResponse = makeMockGenomeNexusResponse(mockGenomeNexusHgvsResponseMap.get(convertToHgvs(record)));
            this.setGnResponse(gnResponse);
            this.setMutationRecord(record);
        }
        catch (IOException e) {
            throw new RuntimeException(e);
        }

        return convertResponseToAnnotatedRecord(REPLACE);
    }

    private GenomeNexusAnnotationResponse makeMockGenomeNexusResponse(String mockReturnJsonString) throws IOException {
        ObjectMapper mapper = new ObjectMapper();
        return mapper.readValue(mockReturnJsonString, GenomeNexusAnnotationResponse.class);
    }
